import React from 'react';
import './paragraph.css'

const Paragraph = () => {
	return (
	 <h1>
	  Name a person of influence and what they do in the United Arab Emirates who inspires you and
	  you would take a coaching class from them.
	 </h1>
	)
}

export default Paragraph;
